import React from 'react';
import { View } from 'react-native';

const Taco = ({tacoBottom, tacoLeft}) => {
  const tacoWidth = 50
  const tacoHeight = 60

  return(
    <View style={{ position: 'absolute',
      backgroundColor: 'blue',
      width: tacoWidth,
      height: tacoHeight,
      left: tacoLeft - (tacoWidth/2),
      bottom: tacoBottom - (tacoHeight/2),
    }} />
  )
}

export default Taco;
